import React from 'react';


function Sum(a,b){
    return a+b ;
}

function Sub(a,b){
    return a-b ;
}

function Div(a,b){
    return Math.floor(a/b) ;
}

function mul(a,b){
    return a*b ;
}

export default Sum;

export {Sub,Div,mul}
